import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the Electronics category link
    await page.waitForSelector('a:has-text("Electronics"):visible');
    await page.click('a:has-text("Electronics"):visible');

    // Wait for navigation to complete
    await page.waitForLoadState('networkidle');

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Verify we're on the Electronics category page by checking for electronics content
    const electronicsContent = await page.textContent('body');
    const hasElectronicsContent = electronicsContent.includes('Electronics') || 
                                 electronicsContent.includes('electronics');

    return {
      success: true,
      action: "Navigated to Electronics category",
      extractedData: {
        hasElectronicsContent: hasElectronicsContent,
        pageTitle: await page.title()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
